(1, 1, NULL, 'Hello FECOJ', '<p>Print the as the output field says</p>', NULL, '<p>Welcome to FECOJ</p>', '<p>In this problem here is not input</p>', NULL, 'Welcome to FECOJ', '1000', '256', '20', '2022-09-29 11:51:17', '2022-09-29 11:51:17'),
(2, 1, NULL, 'Basic Sum', '<p>Take two integers and print the output</p>', '<p>4<br>2 3<br>1 2<br>3 5<br>4 5</p>', '<p>5<br>3<br>8<br>9</p>', '<p>First Line contains the number of testcase</p>', '4\r\n2 3\r\n1 2\r\n3 5\r\n4 5', '5\r\n3\r\n8\r\n9', '2000', '256', '20', '2022-09-29 11:54:22', '2022-09-29 11:54:22'),
(3, 3, NULL, 'Multiply X * Y', '<p>You are given two real numbers <strong>X</strong> and <strong>Y</strong>. Multiply both the numbers and print it.</p><h3><strong>Input</strong></h3><p>Input contains two real numbers <strong>X</strong> and <strong>Y</strong> where (0&lt;=X,Y&lt;=1000).</p><h3><strong>Output</strong></h3><p>Print the answer of X*Y. Error less than 10^-6 will be ignored.</p>', '<p>7 5</p>', '<p>35</p>', '<p>Don\'t forget to print new line</p>', '7 5', '35', '1000', '256', '20', '2022-10-08 07:15:58', '2022-10-08 07:15:58'),
(4, 3, NULL, 'Tribonacci Series?', '<p>Erfan loves to play with equations. In this problem, Tashfiq gives you an equation like that:</p><p><strong>a(n) = a(n-1) + a(n-2) + a(n-3)</strong></p><p>Tashfiq also gives you some information about the equation. These are:</p><p>a(0) = X\r\na(1) = Y\r\na(2) = Z\r\n</p><p>Now, Alam who is a teammate of Tashfiq wants to know the value of <strong>a(n)</strong> from you.</p><p>&nbsp;</p><h3><strong>Input</strong></h3><p>The first line of input contains a single integer <strong>T(1&lt;=T&lt;=50)</strong> which denotes the number of test cases. Each next <strong>T</strong> line of input contains four integers <strong>X, Y, Z, N</strong> where <strong>0&lt;=X, Y, Z &lt;=5</strong> and <strong>(0&lt;=N&lt;=50).</strong></p><h3><strong>Output</strong></h3><p>For each test case, print the required output in a new line.</p>', '<p>3<br>0 0 1 4<br>1 2 3 8<br>5 2 1 10<br>&nbsp;</p>', '<p>2<br>125<br>437<br>&nbsp;</p>', '<p>No notes</p>', '3\r\n0 0 1 4\r\n1 2 3 8\r\n5 2 1 10', '2\r\n125\r\n437', '1000', '256', '20', '2022-10-08 07:30:00', '2022-10-08 07:30:00'),
(5, 3, NULL, 'FEC ID Card', '<p>One day, a student of FEC named Erfan forgot to take his student id. So he tried to enter the gate without his id. But the security guards stopped him and took him to the principal\'s office.</p><p>Now, Mizan sir wants to punish the bad boy Erfan. So, he wants to know the details of Erfan.</p><p>You are given student id of Erfan. Your task is to print the details of Erfan.</p><p>The first two digits determine the session of Erfan.<br>The second two digit denotes the department and <br>The last two digits indicate the roll no.</p><p>Department Code of FEC:</p><p>10 - Civil Engineering</p><p>20 - Electrical & Electronic Engineering</p><p>30 - Computer Science & Engineering</p><h3><strong>Input</strong></h3><p>The input contains a single six digits student id of FEC. It is guaranteed that the student id is a valid FEC student id</p><h3><strong>Output</strong></h3><p>Print the necessary details for the given student id. See sample input and output for more details.</p>', '<p>193044</p>', '<p>Roll No: 44<br>Department: Computer Science &amp; Engineering<br>Session: 2019-2020</p>', '<p>No notes here</p>', '193044', 'Roll No: 44\r\nDepartment: Computer Science & Engineering\r\nSession: 2019-2020', '2000', '256', '20', '2022-10-08 07:40:32', '2022-10-08 07:40:32');

